import React from "react";


const Login=()=>{
return (
    <>
    <form>
        <label for="email">email</label>
        <input type="email" placeholder="abc@gmail.com" id="email" name="email"></input>
        <label for="password">password</label>
        <input type="password" placeholder="Pass@123" id="password" name="password"></input>
        <button type="">Login</button>
    </form>

    
    
    </>
)

}
export default Login;
